DELIMITER //
CREATE TRIGGER `UpdateVentasActivas` AFTER INSERT ON `facturas`
 FOR EACH ROW BEGIN

SELECT MAX(NumVenta) into @NumVentas FROM vestasactivas;

SET @NumVentas=@NumVentas+1;

SELECT MAX(NumFactura) into @NumFacturas FROM vestasactivas;

SET @NumFacturas=@NumFacturas+1;

SELECT MAX(NumCotizacion) into @NumCotizacion FROM vestasactivas;

SET @NumCotizacion=@NumCotizacion+1;

UPDATE vestasactivas SET `NumCotizacion`= @NumCotizacion WHERE Usuario_idUsuario = NEW.Usuarios_idUsuarios;

UPDATE vestasactivas SET `NumVenta`= @NumVentas WHERE Usuario_idUsuario = NEW.Usuarios_idUsuarios;

UPDATE vestasactivas SET `NumFactura`= @NumFacturas WHERE Usuario_idUsuario = NEW.Usuarios_idUsuarios;

END
//
DELIMITER ;

